import React from 'react';
import styled from 'styled-components';

const AboutContainer = styled.div`
  padding: 2rem;
  max-width: 1200px;
  margin: 0 auto;
  color: white;
  background-color: #0a0a0a;
`;

const Title = styled.h1`
  color: #ff9000;
  margin-bottom: 2rem;
  font-size: 2.5rem;
  text-align: center;
`;

const Content = styled.div`
  background-color: #1a1a1a;
  padding: 2rem;
  border-radius: 8px;
  box-shadow: 0 0 20px rgba(255, 144, 0, 0.1);
`;

const ProfileSection = styled.div`
  display: flex;
  gap: 2rem;
  margin-bottom: 2rem;
  flex-wrap: wrap;
`;

const ProfileImage = styled.img`
  width: 200px;
  height: 200px;
  border-radius: 50%;
  border: 3px solid #ff9000;
`;

const InfoSection = styled.div`
  flex: 1;
  min-width: 300px;
`;

const StatsGrid = styled.div`
  display: grid;
  grid-template-columns: repeat(auto-fit, minmax(200px, 1fr));
  gap: 1rem;
  margin-top: 2rem;
`;

const StatBox = styled.div`
  background-color: #252525;
  padding: 1rem;
  border-radius: 4px;
  text-align: center;
  
  &:hover {
    background-color: #303030;
  }
`;

const StatNumber = styled.div`
  font-size: 2rem;
  color: #ff9000;
  font-weight: bold;
`;

const About = () => {
  return (
    <AboutContainer>
      <Title>About Me</Title>
      <Content>
        <ProfileSection>
          <ProfileImage src="https://i.pinimg.com/736x/62/f5/a6/62f5a603cfd879fe20695185eb795fac.jpg" alt="Profile" />
          <InfoSection>
            <h2 style={{ color: '#ff9000' }}>Lipp</h2>
            <p style={{ fontSize: '1.1rem', lineHeight: '1.6' }}>
              Full Stack Developer | IT Professional
            </p>
            <p>
              Passionate about creating amazing web experiences and solving complex problems.
            </p>
          </InfoSection>
        </ProfileSection>

        <StatsGrid>
          <StatBox>
            <StatNumber>50+</StatNumber>
            <div>Projects</div>
          </StatBox>
          <StatBox>
            <StatNumber>5+</StatNumber>
            <div>Years Experience</div>
          </StatBox>
          <StatBox>
            <StatNumber>100%</StatNumber>
            <div>Satisfaction</div>
          </StatBox>
        </StatsGrid>

        <h2 style={{ color: '#ff9000', marginTop: '2rem' }}>Skills</h2>
        <StatsGrid>
          <StatBox>
            <h3>Frontend</h3>
            <p>React, JavaScript, HTML5, CSS3</p>
          </StatBox>
          <StatBox>
            <h3>Backend</h3>
            <p>Java</p>
          </StatBox>
          <StatBox>
            <h3>Tools</h3>
            <p>Git, VS Code, IntelliJ</p>
          </StatBox>
        </StatsGrid>
      </Content>
    </AboutContainer>
  );
};

export default About;
